import Head from 'next/head';


const Layout = (props) => {
  return (
    <div>
      {/* Setting Page Head */}
      <CustomHead title={props.title} />
      {/* STYLING */}
    </div>
  );
};

export default Layout;



function CustomHead({ title }) {
  return (
    <Head>
      <title>Header Blog</title>
      <link rel="stylesheet" href="/css/global.css" />
      <title>{title}</title>
    </Head>
  );
}
